import React from 'react';
import './Emp.css';

const Emp = () => {
  return (
    <div className="bg2">
        <form className="nominee-form">
            <div className='design-rows'>
            <video src='/videos/video-8.mp4' autoPlay loop muted />
            </div>
          <div className="form-group">
            <label htmlFor="nomineeName">Nominee Name</label>
            <input type="text" id="nomineeName" name="nomineeName" required />
          </div>
          <div className="form-group">
            <label htmlFor="relation">Relation</label>
            <input type="text" id="relation" name="relation" required />
          </div>
          <button type="submit" className="submit-button">Add Nominee</button>
        </form>
    </div>
  );
};

export default Emp;
